BlackCab is your driver service for fast, reliable, and accessible rides anytime. You can travel anywhere you want around Bucharest without needing rental car services or wasting your time figuring out bus routes. Our professional drivers will drive you safely right to your destination.

Need to pick up a friend along the way or to drop off your loved ones before heading home? With BlackCab it's easier than ever to quickly make a stop or change the route during your ride.

Why choose BackCab instead of conventional taxi services? 
- Transparent fees - you’ll always know in advance how much your ride costs;
- High-quality, reliable and trustworthy riding service;
- GPS centralised system that allows you to track the driver’s arrival in the app;
- Select, comfortable, and safe vehicles;
- Polite and well-dressed English speaking drivers;
- Ability to book your ride in advance;
- Multiple booking options: mobile app, phone, website;
- Possibility to pay by cash, POS or credit card;
- Wide selection of cars available (premium, luxury, and even economy services).

Whether you are using BlackCab for a ride across town, to go to the airport, to an important business meeting, at a concert, movie or restaurant, there is always a black car for every occasion. Book now your cab and enjoy an affordable, welcoming and memorable ride!

